import * as React from "react";
import { useEffect } from "react";
import { getData } from "../../utils/getData";

function Contribution({ data, setData }: any) {
  // const thisYear = new Date().getFullYear();

  useEffect(() => {
    if (data !== null) {
      const yearBox = data.filter((item: any, i: number) => {
        return item.date.includes("2022");
      });
      console.log(yearBox);
    } else {
      getData(setData);
    }
  });

  return <></>;
}
export default Contribution;
